def maximize_equal_elements(sequence):
    cnt = {}

    def add(x):
        if x not in cnt:
            cnt[x] += 1
        else:
            cnt[x] = 1
    for x in sequence:
        add(x - 1)
        add(x)
        add(x + 1)
    counts = map(lambda x: x[1], cnt.items())
    return max(counts)

